import React from 'react'
import { Link } from 'react-router-dom';
import './Header.scss';
function Header() {
  return (
    <div className='header'>
        <div className='header-container'>
        <Link to={'/'}>Home</Link>
        <Link to={'/about'}>About me</Link>
        </div>

    </div>
  )
}

export default Header
